l proceso, además de verificar la calidad del jabón (pH y consistencia).</span></li>\\n\\t<li><span style=\\\"color:#16a085\\\"><strong>Ingeniería</strong>: Se optimiza el proceso de fabricación para hacerlo eficiente y sostenible, buscando mejorar la producción y utilizar materiales reciclados o empaques ecológicos.</span></li>\\n\\t<li><span style=\\\"color:#16a085\\\"><strong>Arte</strong>: La creación del jabón es también un proceso creativo, donde se diseñan formas, colores y fragancias que hagan el producto atractivo visual y sensorialmente.</span></li>\\n\\t<li><span style=\\\"color:#16a085\\\"><strong>Matemáticas</strong>: Es necesario calcular las proporciones exactas de los ingredientes y medir con precisión, además de analizar el pH del jabón para garantizar su seguridad.</span></li>\\n</ul>\\n\\n<p> </p>\\n\\n<p><span style=\\\"color:#16a085\\\">Aprenden jugando.</span></p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"d296c6af-d393-496d-aa5e-f08d42b6d47f\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"media\":{\"disableImageZooming\":false},\"taskDescription\":\"Arrastrar las palabras a las cajas correctas\",\"overallFeedback\":[{\"from\":0,\"to\":100,\"feedback\":\"Muy bien estas listo para crear tu actividad,\"}],\"checkAnswer\":\"Comprobar\",\"submitAnswer\":\"Enviar\",\"tryAgain\":\"Reintentar\",\"showSolution\":\"Mostrar solución\",\"dropZoneIndex\":\"Zona de colocación @index.\",\"empty\":\"La zona de Colocación @index está vacía.\",\"contains\":\"La zona de Colocación @index contiene elemento @draggable.\",\"ariaDraggableIndex\":\"@index de @count elementos que se pueden colocar.\",\"tipLabel\":\"Mostrar pista\",\"correctText\":\"¡Correcto!\",\"incorrectText\":\"¡Incorrecto!\",\"resetDropTitle\":\"Restablecer colocación\",\"resetDropDescription\":\"¿Seguro que quieres restablecer esta zona de colocación
